# Medium solution
def lengthOfLongestSubstring(s):
    """
    :type s: str
    :rtype: int
    """
    start = _max = 0
    _dict = {}
    for i in range(len(s)):
        if s[i] in _dict and start <= _dict[s[i]]:
            start = _dict[s[i]] + 1
        else:
            _max = max(_max, i - start + 1)
        _dict[s[i]] = i
    return _max
